// Packages

export default function MainFeed({ posts }) {
  return (
    <div>
      <h3>Posts</h3>
      {posts.map((post) => (
        <article>
          <h5>{post.username}</h5>
          <img src={post.img_url} />
          <p>{post.caption}</p>
        </article>
      ))}

    </div>
  )
}
